import{_ as a,c as p,a4 as s,o as i}from"./chunks/framework.CyeRpf1z.js";const o="/pages/github/github-01.png",e="/pages/github/github-02.png",l="/pages/github/github-03.png",c="/pages/github/github-04.png",g="/pages/github/github-05.png",r="/pages/github/github-06.png",u="/pages/github/github-07.png",m="/pages/github/github-08.png",d="/pages/github/github-09.png",n="/pages/github/github-10.png",b="/pages/github/github-11.png",h="/pages/github/github-12.png",_="/pages/github/github-13.png",y="/pages/github/github-14.png",k="/pages/github/github-15.png",f="/pages/github/github-16.png",z="/pages/github/github-17.png",v="/pages/github/github-18.png",G="/pages/github/github-19.png",x="/pages/github/github-20.png",D="/pages/github/github-21.png",q="/pages/github/github-22.png",P="/pages/github/github-23.png",w="/pages/githubpage/githubpage-01.png",C="/pages/githubpage/githubpage-02.png",S="/pages/githubpage/githubpage-03.png",E="/pages/githubpage/githubpage-04.png",N="/pages/githubpage/githubpage-05.png",A="/pages/githubpage/githubpage-06.png",H="/pages/githubpage/githubpage-07.png",O="/pages/githubpage/githubpage-08.png",B="/pages/githubpage/githubpage-09.png",F="/pages/githubpage/githubpage-10.png",$="/pages/githubpage/githubpage-11.png",M="/pages/githubpage/githubpage-12.png",I=JSON.parse('{"title":"Github的注册及使用","description":"","frontmatter":{},"headers":[],"relativePath":"yiov/website/pages/github.md","filePath":"yiov/website/pages/github.md","lastUpdated":1734431113000}'),J={name:"yiov/website/pages/github.md"};function R(W,t,K,L,U,V){return i(),p("div",null,t[0]||(t[0]=[s('<h1 id="github的注册及使用" tabindex="-1">Github的注册及使用 <a class="header-anchor" href="#github的注册及使用" aria-label="Permalink to &quot;Github的注册及使用&quot;">​</a></h1><div class="tip custom-block"><p class="custom-block-title">(当前界面文档全部来自yiov.top)</p><ul><li><a href="https://yiov.top/" target="_blank" rel="noreferrer">yiov</a>「伊奥&#39;s 教程集」</li></ul></div><h2 id="简介" tabindex="-1">简介 <a class="header-anchor" href="#简介" aria-label="Permalink to &quot;简介&quot;">​</a></h2><p>Github是微软旗下的开源项目托管平台，有无数的优质开源项目</p><p>同时也是 <code>全球最大同性交友网站</code> ，啊，不是 →_→，主要是男性比例重</p><p>官网：<a href="https://github.com/" target="_blank" rel="noreferrer">https://github.com/</a></p><p><img src="'+o+'" alt="" loading="lazy"></p><h2 id="注册" tabindex="-1">注册 <a class="header-anchor" href="#注册" aria-label="Permalink to &quot;注册&quot;">​</a></h2><p>在 <a href="https://github.com/" target="_blank" rel="noreferrer">官网</a> 点击 <code>Sign up</code> 注册，填你的邮箱、密码、用户名即可，然后接收验证码</p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>由于网站处于半墙状态，打不开，反复刷新 或者 <a href="./../../gfw/proxy.html">挂梯子</a></p><p>进入的界面是英文的，可以通过 <a href="./../../computer/tampermonkey.html">油猴</a> 安装 <a href="https://greasyfork.org/zh-CN/scripts/407485-github-internationalization" target="_blank" rel="noreferrer">☛GitHub汉化插件</a></p></div><p><img src="'+e+'" alt="" loading="lazy"></p><p>验证人机后，创建账户，然后输入验证码</p><p><img src="'+l+'" alt="" loading="lazy"></p><p><img src="'+c+'" alt="" loading="lazy"></p><p>注册好了，还需要填一些信息，跟我一样的小白，就选 <code>Just me</code> 和 <code>Student</code></p><p><img src="'+g+'" alt="" loading="lazy"></p><p>然后问你的兴趣，不选也可以，直接点继续下一步</p><p><img src="'+r+'" alt="" loading="lazy"></p><p>这一步选免费账户，或者选择学生账户</p><p>学生账户有更多的权益，应该之后会需要学生认证，我没选并不清楚</p><p><img src="'+u+'" alt="" loading="lazy"></p><p>选择 <code>Continue for free</code> ，即可创建完成，进入github</p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>正常情况到这里，都会被墙一下，反复刷新等加载进入即可</p></div><p><img src="'+m+'" alt="" loading="lazy"></p><h2 id="使用" tabindex="-1">使用 <a class="header-anchor" href="#使用" aria-label="Permalink to &quot;使用&quot;">​</a></h2><details class="details custom-block"><summary>新建仓库</summary><p>进入github了，我们点 <code>新建仓库</code></p><p><img src="'+d+'" alt="" loading="lazy"></p><p>仓库名自己取，别打中文字就行，新建仓库</p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>这里的 <code>Add a README file</code> 文件，勾不勾选都不影响，后面可以自己上传</p></div><p><img src="'+n+'" alt="" loading="lazy"></p><p>创建完成后，就进去了我们的仓库页面</p><p><img src="'+b+'" alt="" loading="lazy"></p></details><details class="details custom-block"><summary>客户端：Github Desktop</summary><p>下载 <a href="https://desktop.github.com/" target="_blank" rel="noreferrer">Github Desktop</a> 并安装</p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>下载不了的不要用迅雷，用浏览器自带的</p></div><p><img src="'+h+'" alt="" loading="lazy"></p><p>下载完成，双击安装包，会自动生成一个桌面快捷方式，同时打开登录界面</p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>默认安装在C盘了</p></div><p><img src="'+_+'" alt="" loading="lazy"></p><p>点登入就会自动跳转到浏览器，然后要授权账号</p><p><img src="'+y+'" alt="" loading="lazy"></p><p>点击授权后，打开desktop，被墙了重新打开</p><p><img src="'+k+'" alt="" loading="lazy"></p><p>desktop打开后，要求我们设置用户名和邮箱</p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>用户名默认，邮箱改成我们的常用邮箱即可，点Finish完成</p><p>设置的用处就是，为了知道远程仓库是谁上传的</p></div><p><img src="'+f+'" alt="" loading="lazy"></p><p>选第2个，<code>Clone a repository</code> 克隆仓库到本地</p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>因为我们已经网页创建过了，这里只需要克隆即可</p><p>如果你没有创建，就选第3个，<code>Create a new repository</code></p></div><p><img src="'+z+'" alt="" loading="lazy"></p><p>这里的 <code>Local path</code> 路径，可以自行选择存放的文件夹，然后点 <code>Clone</code> 克隆</p><details class="details custom-block"><summary>这里没有显示</summary><p>点击刷新即可，然后选择我们创建好的仓库</p></details><p><img src="'+v+'" alt="" loading="lazy"></p><p>完成后，在文件夹里就生成了 <code>.git</code> 的隐藏一个文件夹，这样就算完成了</p><details class="details custom-block"><summary>没看到隐藏文件</summary><p>文件夹顶部-查看-勾选 隐藏的项目</p></details><p><img src="'+G+'" alt="" loading="lazy"></p></details><details class="details custom-block"><summary>代码上传</summary><p>进入Github Desktop工作界面，现在里面还啥都没有</p><p><img src="'+x+'" alt="" loading="lazy"></p><p>在文件夹内添加点东西，比如：新建 - 文本文档，然后重命名为 <code>README.md</code></p><details class="details custom-block"><summary>看不到文件拓展名</summary><p>文件夹上方 - 查看 - 勾选 <code>文件拓展名</code></p></details><p><img src="'+D+'" alt="" loading="lazy"></p><p>有文件更新后，客户端界面就有了变动</p><p>勾选文件 - 填写描述 - <code>Commit to main</code>(上传缓存区) - <code>Publish</code>(推送)</p><details class="details custom-block"><summary>如何取消上传</summary><p>在 <code>History</code>里右键选择 <code>undo</code>；没有undo说明时间太久了，只能先提交了</p></details><details class="details custom-block"><summary>推送报错erro：fatal: unable to access</summary><p>github被墙了，别慌，要么继续点，要么<a href="./../../gfw/proxy.html">挂梯子</a></p></details><p><img src="'+q+'" alt="" loading="lazy"></p><p>刷新下页面，就可以看到文件已经上传完成了</p><p><img src="'+P+'" alt="" loading="lazy"></p></details><details class="details custom-block"><summary>静态托管</summary><p>其实就是 <a href="https://pages.github.com/" target="_blank" rel="noreferrer">Github Page</a> ，可以将静态网页内容部署到它的服务器上</p><p><img src="'+w+'" alt="" loading="lazy"></p><p>新建仓库，输入 <code>账户名.github.io</code>，仓库公开即可，确定</p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>比如我的：yiov.github.io</p></div><p><img src="'+C+'" alt="" loading="lazy"></p><p>这样就建好了</p><p><img src="'+S+'" alt="" loading="lazy"></p><p>用GitHub Desktop克隆仓库到本地，然后放入网页源代码</p><p>我这里使用 <a href="https://github.com/zhheo/Wechat-Official-Account-Web" target="_blank" rel="noreferrer">@张洪Heo的微信关注页面</a> 演示，下载</p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>请按照文档，修改成自己的图片及文本</p></div><p><img src="'+E+'" alt="" loading="lazy"></p><p>解压后，放入克隆下来的文件夹</p><p><img src="'+N+'" alt="" loading="lazy"></p><p>用GitHub Desktop上传即可</p><p><img src="'+A+'" alt="" loading="lazy"></p><p>上传完成，我们回到github刷新网页，这样就上传完成了</p><details class="details custom-block"><summary>推送报错erro：fatal: unable to access</summary><p>github被墙了，别慌，要么继续点，要么<a href="./../../gfw/proxy.html">挂梯子</a></p></details><p><img src="'+H+'" alt="" loading="lazy"></p><p>在 <code>Setting - page</code> 这里的 <code>https://yiov.github.io</code> 就是我们的网页了</p><p><img src="'+O+'" alt="" loading="lazy"></p><p>可以访问试试看看，这样就OK了</p><p><img src="'+B+'" alt="" loading="lazy"></p></details><details class="details custom-block"><summary>静态托管：自定义域名</summary><p>如果想用自己的域名，先去 <a href="./../domain/">购买一个域名</a></p><p>然后再域名解析处添加一个 <code>CNAME</code> 值，记录值填这个网址 <code>yiov.github.io</code></p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>我这里用的二级域名 <code>doc</code></p></div><p><img src="'+F+'" alt="" loading="lazy"></p><p>回到github设置，下拉在自定义域名里填入我们的二级域名，保存</p><p>等解析完成，过程会有点慢，直到显示 <code>DNS Check successful</code>即可</p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>我这里是 <code>doc.***.com</code></p><p>建议是勾选 htpps</p></div><p><img src="'+$+'" alt="" loading="lazy"></p><p>然后我们就能看到域名已经变成自己的了</p><div class="warning custom-block"><p class="custom-block-title">注意</p><p>如果你要删除域名，先删掉输入的域名，然后再点<code>移除</code></p><p>否则只点移除是没用的</p></div><p><img src="'+M+'" alt="" loading="lazy"></p></details><h2 id="常见问题" tabindex="-1">常见问题 <a class="header-anchor" href="#常见问题" aria-label="Permalink to &quot;常见问题&quot;">​</a></h2><details class="details custom-block"><summary>如何创建分支</summary><p>默认main，想创建新的分支的，在Github Desktop顶部 - Branch-NewBranch</p></details><details class="details custom-block"><summary>如何删除仓库</summary><p>Github网页进入想删的仓库-设置，拉倒最底部，Delete this repository 删除仓库</p></details><details class="details custom-block"><summary>如何把别人项目添加到自己的仓库</summary><p>在别人的项目主页，右上角 - Fork复刻</p></details><details class="details custom-block"><summary>网页端修改了，如何同步到本地仓库</summary><p>在客户端点一键Fetch即可，Fetch Origin点一下会变成Pull Origin，再次点击即可同步</p></details><details class="details custom-block"><summary>能托管多少个静态网站</summary><ul><li><p>一个：帐户名只能一个，比如：<code>用户名.github.io</code></p></li><li><p>多个：仓库可以有无数个，比如：<code>用户名.github.io/仓库名</code>，只需要在仓库页面下选择 Setting - pages，分支为main，选择root保存</p></li></ul></details>',36)]))}const Q=a(J,[["render",R]]);export{I as __pageData,Q as default};
